e"},{"attributes":{"line_alpha":0.1,"line_color":"#8ca252","line_width":2,"x":{"field":"annee"},"y":{"field":"nombre"}},"id":"1177","type":"Line"},{"attributes":{},"id":"1649","type":"StringEditor"},{"attributes":{"source":{"id":"1294"}},"id":"1300","type":"CDSView"},{"attributes":{},"id":"1644","type":"StringEditor"},{"attributes":{},"id":"1645","type":"StringFormatter"},{"attributes":{"data":{"annee":[2017,2018,2019,2020,2021],"index":[13,22,36,49,62],"nombre":{"__ndarray__":"AAAAAAAA8D8AAAAAAAAxQAAAAAAAADpAAAAAAADAVUAAAAAAAAAxQA==","dtype":"float64","order":"little","shape":[5]},"sous_categorie":["Colombid\u00e9s","Colombid\u00e9s","Colombid\u00e9s","Colombid\u00e9s","Colombid\u00e9s"]},"selected":{"id":"1327"},"selection_policy":{"id":"1326"}},"id":"1294","type":"ColumnDataSource"},{"attributes":{"line_alpha":0.1,"line_color":"#bd9e39","line_width":2,"x":{"field":"annee"},"y":{"field":"nombre"}},"id":"1297","type":"Line"},{"attributes":{"source":{"id":"1174"}},"id":"1180","type":"CDSView"},{"attributes":{},"id":"1041","type":"UnionRenderers"},{"attributes":{},"id":"1042","type":"Selection"},{"attributes":{"style":{"text-align":"center"},"text":"        &lt;h2 style='color:teal;'&gt;Un bref r\u00e9capitulatif de tout ce qu'il y a \u00e0 savoir sur les oiseaux en Bretagne&lt;/h2&gt;"},"id":"1664","type":"Div"},{"attributes":{"coordinates":null,"data_source":{"id":"1126"},"glyph":{"id":"1128"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1130"},"nonselection_glyph":{"id":"1129"},"view":{"id":"1132"}},"id":"1131","type":"GlyphRenderer"},{"attributes":{},"id":"1124","type":"Selection"},{"attributes":{"style":{"font-size":"15px","font-weight":"500","text-align":"center","text-justify":"auto"},"text":"        &lt;h1 style='color:cornflowerblue;'&gt;Les oiseaux en Bretagne&lt;/h1&gt;        &lt;h2 style='color:teal;'&gt;Auteur : Bill Yehouenou #22210577&lt;/h2&gt;        &lt;p&gt;La Bretagne est une r\u00e9gion riche en biodiversit\u00e9, notamment en ce qui concerne &lt;b style='color:indianred;'&gt;les oiseaux&lt;/b&gt;. Cette r\u00e9gion attire de nombreux passionn\u00e9s d'ornithologie et des touristes venus d\u00e9couvrir les esp\u00e8ces locales. L'\u00e9tude de la &lt;a href='https://data.bretagne.bzh/explore/dataset/observations-faunistiques-sur-et-aux-abords-des-voies-navigables-bretonnes-geres/map/?location=8,48.0416,-2.83287&amp;basemap=jawg.streets'&gt;&lt;b&gt;faune bretonne&lt;/b&gt;&lt;/a&gt; est un sujet passionnant, qui permet de mieux comprendre les interactions entre les diff\u00e9rentes esp\u00e8ces et leur environnement. En particulier, l'observation des oiseaux est une pratique qui permet d'en apprendre beaucoup sur leur mode de vie, leur habitat, etc... En analysant l'\u00e9volution temporelle des populations d'oiseaux par esp\u00e8ce, il est possible de mettre en \u00e9vidence les changements environnementaux qui ont lieu dans la r\u00e9gion. L'\u00e9tude des oiseaux en Bretagne est donc un enjeu important pour la pr\u00e9servation de la biodiversit\u00e9 et la compr\u00e9hension des \u00e9cosyst\u00e8mes locaux.&lt;/p&gt;        "},"id":"1662","type":"Div"},{"attributes":{},"id":"1123","type":"UnionRenderers"},{"attributes":{"style":{"text-align":"center"},"text":"        &lt;h2 style='color:teal;'&gt;D\u00e9couvrez les observations d'oiseaux en Bretagne gr\u00e2ce \u00e0 notre carte interactive. Localisez les esp\u00e8ces les plus fr\u00e9quentes dans la r\u00e9gion et explorez la diversit\u00e9 de la faune locale. Un outil essentiel pour les ornithologues et les amoureux de la nature.&lt;/h2&gt;"},"id":"1665","type":"Div"},{"attributes":{"data":{"annee":[2012,2017,2018,2019,2020,2021],"index":[4,17,29,43,56,69],"nombre":{"__ndarray__":"AAAAAAAAAEAAAAAAAAA0QAAAAAAAAEdAAAAAAACwgEAAAAAAACBkQAAAAAAAwFpA","dtype":"float64","order":"little","shape":[6]},"sous_categorie":["Rallid\u00e9s","Rallid\u00e9s","Rallid\u00e9s","Rallid\u00e9s","Rallid\u00e9s","Rallid\u00e9s"]},"selected":{"id":"1147"},"selection_policy":{"id":"1146"}},"id":"1126","type":"ColumnDataSource"},{"attributes":{"style":{"font-size":"15px","font-weight":"500","text-align":"center","text-justify":"auto"},"text":"&lt;p&gt;La visualisation des donn\u00e9es sur les oiseaux en Bretagne offre de nombreux avantages. Tout d'abord, elle permet de mieux comprendre la r\u00e9partition et l'\u00e9volution des populations d'oiseaux dans la r\u00e9gion, en mettant en \u00e9vidence les zones les plus riches en biodiversit\u00e9 et les esp\u00e8ces les plus menac\u00e9es. Cela permet aux chercheurs et aux autorit\u00e9s locales de mieux cibler les efforts de conservation et de restauration des habitats naturels. De plus, la visualisation des donn\u00e9es sur les oiseaux peut aider \u00e0 identifier les facteurs de stress environnementaux qui affectent les populations d'oiseaux, tels que la perte d'habitat, la pollution et les changements climatiques. En analysant les donn\u00e9es \u00e0 long terme, les chercheurs peuvent \u00e9galement \u00e9valuer l'impact des mesures de conservation et de restauration mises en place. La visualisation des donn\u00e9es peut \u00e9galement \u00eatre utile pour sensibiliser le grand public \u00e0 la richesse de la faune bretonne et \u00e0 l'importance de sa conservation. En rendant les donn\u00e9es sur les oiseaux plus accessibles et plus compr\u00e9hensibles, les citoyens peuvent mieux comprendre l'importance de la biodiversit\u00e9 et \u00eatre encourag\u00e9s \u00e0 participer \u00e0 des initiatives de conservation. En somme, la visualisation des donn\u00e9es sur les oiseaux en Bretagne est un outil pr\u00e9cieux pour la gestion de la faune et de l'environnement dans la r\u00e9gion. Elle permet de mieux comprendre les interactions entre les diff\u00e9rentes esp\u00e8ces et leur environnement, d'identifier les menaces pour la biodiversit\u00e9 et de mettre en place des mesures de conservation efficaces.&lt;/p&gt;"},"id":"1663","type":"Div"},{"attributes":{"source":{"id":"1105"}},"id":"1111","type":"CDSView"},{"attributes":{"style":{"text-align":"center"},"text":"        &lt;h2 style='color:teal;'&gt;La base de donn\u00e9es compl\u00e8te de tous les oiseaux en Bretagne&lt;/h2&gt;"},"id":"1666","type":"Div"},{"attributes":{},"id":"1199","type":"Selection"},{"attributes":{"style":{"font-size":"14px","text-align":"center","text-justify":"auto"},"text":"        &lt;p style='color:black;'&gt;\u00a9 2023, Universit\u00e9 de Rennes - Master 1 Math\u00e9matiques Appliqu\u00e9es, Statistiques&lt;/p&gt;"},"id":"1667","type":"Div"},{"attributes":{"line_alpha":0.8,"line_color":"#9c9ede","line_width":2,"x":{"field":"annee"},"y":{"field":"nombre"}},"id":"1128","type":"Line"},{"attributes":{"text":"&lt;img src='img1.jpg' title='Mouette rieuse' style='width: 350px; height: 600px;'&gt;"},"id":"1668","type":"Div"},{"attributes":{"text":"&lt;img src='img2.jpg' title='H\u00e9ron cendr\u00e9' style='width: 350px; height: 600px;'&gt;"},"id":"1669","type":"Div"},{"attributes":{"children":[{"id":"1668"},{"id":"1669"},{"id":"1670"},{"id":"1671"}]},"id":"1672","type":"Row"},{"attributes":{"toolbar":{"id":"1780"},"toolbar_location":"above"},"id":"1781","type":"ToolbarBox"},{"attributes":{"text":"&lt;img src='img4.jpg' title='Bulbul orph\u00e9e' style='width: 350px; height: 600px;'&gt;"},"id":"1671","type":"Div"},{"attributes":{"text":"&lt;img src='img3.jpg' title='Macareux moine' style='width: 350px; height: 600px;'&gt;"},"id":"1670","type":"Div"},{"attributes":{"toolbar":{"id":"1674"},"toolbar_location":"above"},"id":"1675","type":"ToolbarBox"},{"attributes":{"children":[{"id":"1752"},{"id":"1750"}]},"id":"1753","type":"Column"},{"attributes":{"children":[[{"id":"1662"},0,0],[{"id":"1672"},1,0],[{"id":"1663"},2,0],[{"id":"1667"},3,0]]},"id":"1673","type":"GridBox"},{"attributes":{"children":[[{"id":"1666"},0,0],[{"id":"1661"},1,0],[{"id":"1667"},2,0]]},"id":"1779","type":"GridBox"},{"attributes":{"child":{"id":"1753"},"title":"Cartographie"},"id":"1785","type":"Panel
